import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <React.Fragment>
      <nav className="navbar navbar-expand-lg navbar-dark">
        <div className="container">
          <Link to="/" className="navbar-brand">
            Redux Tool Kit
          </Link>
        </div>
      </nav>
    </React.Fragment>
  );
};

export default Navbar;
